Vector2f sample_default_shading(float wo_dot_normal, float roughness) {
    int wo_dot_normal_index = int(wo_dot_normal * (default_shading_angle_sample_count - 1) + 0.5f); 
    int roughness_index = int(roughness * (default_shading_roughness_sample_count - 1) + 0.5f); 
    return default_shading[wo_dot_normal_index + roughness_index * default_shading_angle_sample_count]; 
}

